"use strict";
(function($) {
	var that = $.auth || {};
	$.auth = that;
	that.notify = function(event, eventData, info) {
		switch (event) {
			case "pagechange":
				that.resetData(eventData, info);
				break;
			case "pageload":
				that.loadData(eventData, info);
				break;
		}
		return eventData;
	};
	that.resetData = function(eventData, info) {};
	that.loadData = function(eventData, info) {};

})(jQuery);